  componentDidMount() {
    this.setState({count: 1});
  }

  render() {

    console.log(this.state.count);

    return (
      <div>
        <h1>Just Block</h1>
      </div>
    )
  }
}

const Main = () => {

  return (
    <div className="page">
      <Carousel />
      <Block />
    </div>
  );
};

export default Main;
